import React from 'react';
import Table from 'react-bootstrap/Table';
import Nav from 'react-bootstrap/Nav';
import NavItem from 'react-bootstrap/NavItem';

function LeagueAdminPage({ data }) {
    return (
      <div>
        <h1>League Admin Page</h1>
        <Nav variant="tabs">
            <Nav.Item>

            </Nav.Item>
        </Nav>
      </div>
    );
  }

function TeamsTable({data}){
    return(
        <div>
        <h2>Teams</h2>
        <Table striped bordered hover responsive size="sm">
          <thead>
            <tr>
              <th>Team Name</th>
              <th>Team Size</th>
              <th>League Admin</th>
            </tr>
          </thead>
          <tbody>
            {data?.teams?.map((team, index) => (
              <tr key={index}>
                <td>{team.team_name}</td>
                <td>{team.team_size}</td>
                <td>{team.league_admin}</td>
              </tr>
            ))}
          </tbody>
        </Table>
      </div>
    );
}

function PlayersTable({data}){
    return (
    <div>
        <h2>Players</h2>
        <Table striped bordered hover responsive size="sm">
          <thead>
            <tr>
              <th>Name</th>
              <th>Average Score</th>
              <th>Games Participated</th>
              <th>Team</th>
            </tr>
          </thead>
          <tbody>
            {data?.players?.map((player, index) => (
              <tr key={index}>
                <td>{player.name}</td>
                <td>{player.average_score}</td>
                <td>{player.games_participated}</td>
                <td>{player.team}</td>
              </tr>
            ))}
          </tbody>
        </Table>
      </div>
    );
}




export default LeagueAdminPage;
